INSERT INTO `advisory_answers` VALUES (1,1,'1','14 Bí Mật Gia Tăng Tài Chính Mỗi Ngày','Đây là câu trả lời','1','2020-04-06 10:00:24','1','2020-04-06 10:00:24',NULL,'2020-04-06 10:00:24'),(2,2,'1','Lams Fund trả lời','Bước 1: Quá khứ nắm giữ chìa khóa của tương lai tài chính của bạn như thế nào?\r\nBước 2: Đối mặt với nỗi sợ hãi và tạo ra sự thật.\r\nBước 3: Hãy thành thật với chính mình.\r\nBước 4: Chịu trách nhiệm cho những gì bạn yêu thương\r\nBước 5: Tôn trọng bản thân bạn và cả tiền của bạn.\r\nBước 6: Tin tưởng bản thân hơn tin người khác.\r\nBước 7: Cởi mở đón nhận tất cả những gì thuộc về bạn.\r\nBước 8: Hiểu được dòng chảy trong chu kỳ của tiền bạc.\r\nBước 9: Nhận ra sự giàu có đích thực','1','2020-04-06 10:15:25','1','2020-04-06 10:15:25',NULL,'2020-04-06 10:15:25'),(3,6,'1','Fund: giải đáp yêu cầu ở website','nhập các thông tin cơ bản để đăng ký hoặc liên hệ hotline','1','2020-04-17 08:58:22','1','2020-04-17 08:58:22',NULL,'2020-04-17 08:58:22');
