INSERT INTO `advisorys` VALUES (1,'Nguyễn Quyên','it5@lamians.com','03555555555','Cần gíúp đỡ','Tiền không phải là chìa khóa vạn năng. Nhưng không có tiền thì \"vạn vật bất năng\".\r\n? Làm thế nào để luôn rủng rỉnh tiền trong túi?\r\nMột là tiết kiệm nhiều hơn, hai là phải kiếm được nhiều tiền hơn. Bạn đã chọn cách nào? Bạn chưa có câu trả lời hoặc đã làm mà chưa thực sự hiệu quả?\r\n\r\n?14 bí mật CHƯA TỪNG được BẬT MÍ, hé lộ phương pháp gia tăng tài chính bằng cách tập trung vào việc quản lý các khoản chi phí hàng tháng một cách thông minh, xoay quanh 3 trọng tâm lớn:\r\n? Lập kế hoạch Thu - Chi hiệu quả.\r\n? Tối giản ngưỡng chi phí cuộc sống: tối ưu hóa chi phí và sống đơn giản.\r\n? Quản lý kế hoạch & gửi tiền tiết kiệm hàng tháng.',1,1,'1','13','2020-04-06 09:54:28','13','2020-04-06 10:00:24',NULL,'2020-04-06 09:54:28'),(2,'Quyên Test','it5@lamians.com','03745703333','Cần hỗ trợ tư vấn','1.  \"Lớp Học Về Tiền\'\' là cuốn sách làm thay đổi lớn về quan điểm sử dụng tiền bạc.\r\n\r\nCốt lõi trong thông điệp của bà là truyền cảm hứng để tái lập một Giấc mơ Mỹ dựa trên lòng chính trực và “niềm tin vào bản thân”.\r\n\r\n Bạn sẽ được trải nghiệm: Lớp học 1: Giấc mơ Mỹ (mới); Lớp học 2: Chấp nhận sự thật về bản thân; Lớp học 3: Gia đình; Lớp học 4: Nhà cửa; Lớp học 5: Sự nghiệp; Lớp học 6: Lập kế hoạch nghỉ hưu khi bắt đầu bước vào độ tuổi 20 & 30; Lớp học 7: Kế hoạch nghỉ hưu - Điều chỉnh kế hoạch nghỉ hưu vào độ tuổi 40 & 50; Lớp học 8: Cuộc sống hưu trí; Lớp học 9: Bài học cuối cùng\r\n\r\nNổi tiếng với phong cách kết hợp giữa hiểu biết và hài hước, Orman trang bị cho người đọc những lời khuyên kịp thời, mạnh mẽ và thường rất đáng ngạc nhiên cho mục tiêu nắm bắt một chuỗi những nguyên tắc tài chính quan trọng nhất: đó là hiểu biết về thị trường bất động sản, nâng cao nhận thức tài chính cho con trẻ, các khoản vay đại học, các khoản tiết kiệm và đầu tư, kế hoạch nghỉ hưu; và hơn thế nữa.',2,0,'1','13','2020-04-06 10:14:35','13','2020-04-06 10:15:25',NULL,'2020-04-06 10:14:35'),(3,'Quyen Test','it9@lamians.com','0384555555','Test xử lý','\"Giải mã\" là một trong số ít các cuốn sách có thể chạm đến sự quan tâm của tất cả các nhóm độc giả, từ doanh nghiệp, nhà đầu tư cho đến gia đình. Đây thực sự là một con đường tắt để các doanh nhân có thể nhận thức được đặc thù của môi trường kinh tế Việt Nam và áp dụng các nguyên tắc tư duy vào hoạt động quản lý doanh nghiệp. Trong “Giao dịch lớn 2.0”, sự giảng giải sắc bén của Peter Pham về những thách thức mà kỹ thuật phân tích truyền thống đang gặp phải là phần hay nhất mà tôi từng đọc (theo Brent Penfold, nhà giao dịch – chuyên gia tư vấn của indextrader.com.au; tác giả cuốn “The Universal Principles of Successful Trading”). Đây là cuốn sách dễ đọc và phải đọc với mọi nhà giao dịch.',NULL,NULL,'0','13','2020-04-08 12:15:02','13','2020-04-08 12:15:02',NULL,'2020-04-08 12:15:02'),(4,'Phan Công 2','it4@lamians.com','214214','Hi BPS','Ho tro KH test web',NULL,0,'0',NULL,'2020-04-17 08:46:53',NULL,'2020-04-17 08:46:53',NULL,'2020-04-17 08:46:53'),(5,'Phan Công 2','it4@lamians.com','32325','Hi LAMs','Ho tro test login',NULL,1,'0','4','2020-04-17 08:47:59','4','2020-04-17 08:47:59',NULL,'2020-04-17 08:47:59'),(6,'Quyen Test','dichvunph@gmail.com','0384814068','Cần gíúp đỡ đăng ký tài khỏan','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Quis ipsum suspendisse ultrices gravida. Risus commodo viverra maecenas accumsan lacus vel facilisis. Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.',NULL,0,'1','13','2020-04-17 08:55:35','13','2020-04-17 08:58:22',NULL,'2020-04-17 08:55:35'),(7,'Quyen Test 3','it5@lamians.com','0384813332','Test thông báo yêu cầu từ web','Nếu khách hàng có nhu cầu tư vấn gia tăng dòng tiền cá nhân, xin vui lòng liên hệ vói chúng tôi qua các thông tin sau đây.\r\n\r\nĐịa chỉ: L4-42.OT05 (Officetel) , Tòa Landmark 4 Vinhomes Central Park, Số 720A Điện Biên Phủ, Phường 22, Quận Bình Thạnh, TP.HCM\r\nSố điện thoại: 028.3636.4405 – 08.4966.4005 (Zalo/Viper/Skype)\r\nEmail: info@lamians.com\r\nHoặc gửi thông tin cho chúng tôi để chúng tôi chủ động liên hệ đặt hẹn tư vấn cho bạn:',NULL,0,'0','13','2020-04-17 09:47:26','13','2020-04-17 09:47:26',NULL,'2020-04-17 09:47:26');
